import React from 'react';
import { Text, StyleSheet } from 'react-native';

const Header = () => {
    return (
        <Text style={styles.text}>Headeer</Text>
    );
};

const styles = StyleSheet.create({
    header: {
      paddingTop: 50,
      height: 90,
      backgroundColor: '#37474F',
      flexDirection: 'row',
      justifyContent: 'center'
    },
    textLogo1: {
      fontWeight: 'bold',
      fontSize: 18,
      fontFamily: "Play_700Bold",
      color: '#ED7947',
      marginLeft: 10,
      marginRight: 5,
    },
    textLogo2: {
      fontWeight: 'bold',
      fontFamily: "Play_700Bold",
      fontSize: 18,
      color: '#FFF'
    },
    tinyLogo: {
      width: 25,
      height: 25,
    },
  });
  

export default Header;
